import { useParams } from "react-router-dom";
import { Img, Title, Wrap } from "./styled";

interface Props {
  imgUrl: string;
  title: string;
}

export default function CompanyCard(props: Props) {
  const { id } = useParams();

  return (
    <Wrap>
      <Img $backgroundImg={props.imgUrl} />
      <Title>{props.title}</Title>
    </Wrap>
  );
}
